import React, { useState } from "react";

import "./Form.css"

const [name , setName] = useState("Hello")

const showdata=()=>{
    setName("")
}
const Form =()=>{

    return(
        <div className="container">
         <h1>{name}</h1>
         <input type="text" onChange={showdata} placeholder="Enter the value" /><br /><br />
         <button>Submit</button>
        </div>
    )
}

export default Form;
